const AllContry  = styled.div`
width  : 100%;
height : auto;
z-index : 200;
text-align : center;
background-color :none;
display : flex;
flex-direction : row;
flex-wrap : wrap;
`


const Headertext = styled.p`
color : black;
font-weight : 800;
font-family : sans-serif;
width  :100%
`


const Countrycontent = styled.div`
height : 130px;
width : 250px;
border : solid 1px black;
margin-top : 10px;
margin-left   :30px;


@media (max-width: 550px) {
margin-left : 20%


  }


`  



function Countrys() {


const {countries}  = useContext(Mycontext)




  return (
    <div>
      <AllContry>
        <Headertext>Country</Headertext>
      {
        countries.map((f) => {
          return (
            <div><Countrycontent></Countrycontent></div>
          )
        })
      }



      </AllContry>
    </div>
  )
}


export default Countrys
